Question: For some constants $a$ and $b,$ let \[f(x) = \left\{
\begin{array}{cl}
9 - 2x & \text{if } x \le 3, \\
ax + b & \text{if } x > 3.
\end{array}
\right.\]The function $f$ has the property that $f(f(x)) = x$ for all $x.$ What is $a + b?$
Answer:

output:
Let $x = 3.$ Then $f(f(x)) = f(9 - 2x) = f(9 - 2 \cdot 3) = f(3) = 9 - 2 \cdot 3 = 3.$
Then $f(3) = 3,$ so $a + b = 3.$

[asy]
import graph;

size(200);

real f(real x) {
  if (x <= 3) {
    return 9 - 2*x;
  } else {
    return a*x + b;
  }
}

draw(graph(f,-10,10),red);
draw((-10,0)--(10,0),Arrows);
draw((0,-10)--(0,10),Arrows);
dot("$x$", (3,0), NE);
dot("$f(x)$", (9,0), NE);
dot("$f(f(x))$", (3,3), NE);
[/asy] The answer is: 3

